// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0.0;

import "../library/library.sol";
// we cant use remote library, for ex. from gitHub

contract TestLibraries {
    using IntExtended for uint;
    // using IntExtended for *;

    function testIncrement(uint _base) public pure returns (uint) {
        // _base.decrement();
        _base.incrementByValue(4);
        return _base.increment();
    }
}

contracts/library/library.sol.content:
pragma solidity >=0.7.0 <0.9.0 .0;

// SPDX-License-Identifier: GPL-3.0

library IntExtended {
    function increment(uint _self) public pure returns (uint) {
        return _self + 1;
    }

    function decrement(uint _self) public pure returns(uint) {
        return _self - 1;
    }

    function incrementByValue(uint _self, uint _value) public pure returns(uint) {
        return _self + _value;
    }

    function decrementByVakue(uint _self, uint _value) public pure returns(uint) {
        return _self - _value;
    }


}

